import React from 'react';
import {Container} from './styles.js';

export default function Navbar_Component(){

  return(
    <Container>
          <ul>
            <li>
              <a href="/Home" >Início</a>
              <a href="/Dados" >Dados</a>
              <a href="/Metodologia" >Metodologia</a>
              <a href="/Contato" >Contato</a>
            </li>
          </ul>
    </Container>
  )
}
